function Index() {

    return(
        <div>
        <a className="logo" href="/">Tiger</a>
        <ul className="navlist">
            <li><a href="/">Inicio</a></li>
            <li><a href="/">Sobre</a></li>
            <li><a href="/">Projetos</a></li>
            <li><a href="/">Contato</a></li>
        </ul>
        </div>
    )
}

export default Index;
